export default function Front() {
  return (
  	<div className="front">
    	<h1>Frederik Winther</h1>
    	<h2>Designer, Full Stack Developer & Triathlete</h2>

    	<style jsx>{`
    		.front {
    			background: grey;
    			width: 100%;
    			margin-left: 0;
    			margin-right: 0;
    		}

    	`}
    	</style>
    </div>
  )
}
